    this.state = {
      user: {
        firstName : "Ankit",
        lastName : "Sinha",
        img: `https://pbs.twimg.com/profile_images/1019277956286304256/DBOt4zgP_400x400.jpg`
      }
    }
  }
  handleLogOut = (e) => {
    // const { user } = this.props
    const { user } = this.state;
    // console.log(user, 'in user.js');
    console.log(user, 'checking user');
    this.setState({
     user: user
    })
    console.log("log out")
  }

  render() {
    const { user } = this.state;
    return (
      <>
      <Login />
      </>
    )
  }
}

export default App;
